#!/usr/bin/env python

with open("prot.RNAcodons.dat",'r') as f:
    RNAcodons={}
    for line in f:
        if line:
            keys=[0,2,4,6]
            newline=line.split()
            for i in keys:
                j = i + 1
                RNAcodons[newline[i]] = newline[j]
        else:
            print (RNAcodons)

mRNA=''
start=mRNA.index('AUG')
protein=''
for i in range(start,len(mRNA),3):
    AA = RNAcodons[mRNA[i:i+3]]
    if AA and AA != 'Stop':
        protein+=AA
print (protein)

